import React from "react";
import { Header, Icon, Image } from "semantic-ui-react";

const Feed = ({name, subject}) => (
  <Header as="h4">
    <Image src="https://picsum.photos/40/40" avatar />
    <Header.Content>
      <Header.Subheader>
        {subject} <span style={{fontSize:'10px', float:'right', marginLeft:'5px', textTransform:'none'}}>5 sec</span>
      </Header.Subheader>
      {name}
    </Header.Content>
  </Header>
);

export default Feed;
